message:
- rewrite code for notification observers about changes in DB;
- updated logic displaying and updating current list of messages;
- imported released versions of QuickBlox Android SDK and ChatMessagesAdapter-android;

- in Dialogs activity used model QBChatDialog instead of Dialog;
- fixed QMUN-1933;
- fixed QMUN-1942;

- fixed some issues with importing friends for facebook login type;
- optimized code for hiding Twitter Digits credentials;
- some minor fixes;

- reviewed code and updated all deprecated methods from QuickBlox Android SDK;
- downgraded JDK version to 1.7;
- downgraded build tools version to 23.0.2
- changed app version name to 2.0.1

- fixed next bugs:
  -- QMUN-1662 - Calls. The app crashes if the opponent ends a call when user is restoring the app from tray;
  -- QMUN-1663 - Calls. Call screen disappears if user is in the background during the call and gets the push-notification about new message;
- in progress - QMUN-1672

- fixed bug QMUN-1391 Offline mode:
     + added check of the Internet by clicking on the button "add to contact list";
     +  added check of the Internet before opening dialog without cached messages.

- fixed crush where user login to chat and displayed crouton;
- now download the entire list of users (not 100 as it was before);
- changed app version;
